import Card from "./components/Card/Card";
import Toolbar from "./components/Toolbar/Toolbar";
import "./App.css";

// import useDataApi from "./service/useDataApi";

function App() {
  const { result } = useDataApi();
  // console.log(result);
  return (
    <div className="App">
      <Toolbar />
      <Card data={result} />
    </div>
  );
}

export default App;
